namespace Porfolio.Api.Controllers
{
    [Route("api/[controller]")]
    [ApiController]
    public class ProjectController : ControllerBase
    {
        private readonly PorfolioDbContext context;

        public ProjectController(PorfolioDbContext context)
        {
            this.context = context;
        }

        // GET: api/<ProjectController>
        [HttpGet]
        public ActionResult Get()
        {
            try 
            {
                //var list = context.Projects.ToList();//Base de datos no publicada en produccion
                //var dtoList = list.ToDto();
                var dtoList = new List<ProjectDto>(){
                    new ProjectDto() {
                        Id = 1,
                        Title = "Titulo 1",
                        Description = "Descripcion",
                        Base64Image = "data:image/png;base64,"
                    },
                    new ProjectDto()
                    {
                        Id = 1,
                        Title = "Titulo 1",
                        Description = "Descripcion",
                        Base64Image = "data:image/png;base64,"
                    },
                    new ProjectDto()
                    {
                        Id = 1,
                        Title = "Titulo 1",
                        Description = "Descripcion",
                        Base64Image = "data:image/png;base64,"
                    }
                };
                return Ok(dtoList);
            }
            catch(Exception ex)
            {
                return BadRequest(ex.Message);
            }
        }

        // GET api/<ProjectController>/5
        [HttpGet("{id}", Name ="GetProject")]
        public ActionResult Get(int id)
        {
            //Base de datos no publicada en produccion
            try
            {
                var projectModel = context.Projects.FirstOrDefault(x => x.Id == id);
                var projectDto = projectModel.ToDto();
                return Ok(projectDto);
            }
            catch(Exception ex) 
            {
                return BadRequest(ex.Message);
            }
        }

        // POST api/<ProjectController>
        [HttpPost]
        public ActionResult Post([FromBody] ProjectDto project)
        {
            //Base de datos no publicada en produccion
            try
            {
                context.Projects.Add(project.FromDto());
                context.SaveChanges();
                return Ok(project);
            }
            catch(Exception ex)
            {
                return BadRequest(ex.Message);
            }
        }

        // PUT api/<ProjectController>/5
        [HttpPut("{id}")]
        public ActionResult Put(int id, [FromBody] ProjectDto project)
        {
            //Base de datos no publicada en produccion
            try
            {
                var dbItem = context.Projects.FirstOrDefault(x => x.Id == id);
                if (dbItem != null) {
                    dbItem = project.FromDto();
                    context.Entry(dbItem).State = Microsoft.EntityFrameworkCore.EntityState.Modified;
                    context.SaveChanges();
                    return Ok(dbItem.ToDto());
                }
                else
                {
                    return BadRequest();
                }
            }
            catch (Exception ex)
            {
                return BadRequest(ex.Message);
            }
        }

        // DELETE api/<ProjectController>/5
        [HttpDelete("{id}")]
        public ActionResult Delete(int id)
        {
            //Base de datos no publicada en produccion
            try
            {
                var project = context.Projects.FirstOrDefault(x => x.Id == id);
                if (project != null)
                {
                    context.Projects.Remove(project);
                    context.SaveChanges();
                    return Ok(id);
                }
                else
                {
                    return BadRequest();
                }
            }
            catch (Exception ex)
            {
                return BadRequest(ex.Message);
            }
        }
    }
}
